import React from 'react';
import './Main.css';
import Product from '../components/Product';
import images from '../images/acrap.jpg'

function Main() {

  const products = [
    { header: 'Товар 1', images: images, price: 120 },
    { header: 'Товар 2', images: images, price: 2990 },
    { header: 'Товар 3', images: images, price: 3990 },
    { header: 'Товар 4', images: images, price: 49900 },
    { header: 'Товар 5', images: images, price: 599 },
    { header: 'Товар 6', images: images, price: 69900 }
  ]

  function getProductList(){
    return products.forEach((item) => <Product header={item.header} images={images} price={item.price} /> )
  }

  return (
    <div className="Main">
      { getProductList() }
    </div>
  );
}

export default Main;
